/* Function  structure for function  `total_buku` */

/*!50003 DROP FUNCTION IF EXISTS `total_buku` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` FUNCTION `total_buku`(kode_key INT(11)) RETURNS int(11)
    DETERMINISTIC
BEGIN
 DECLARE total_buku INT;
 SELECT COUNT(isbn) INTO total_buku FROM tb_buku INNER JOIN tb_kategori USING (kode_kategori) WHERE kode_kategori = kode_key;
 RETURN total_buku;
END */$$
